import React from 'react';
import {Link } from "react-router-dom";
//import {data1} from './components/BasicTable';
export const Navbar=()=>{
    return(
        <nav className='nav justify-content-end  '>
            <button className='btn btn-primary mr-3 mt-4 mb-3'  button type="button">
            <Link to={{pathname:"/", state:{}}}>Home</Link>
            </button>

            <button className='btn btn-primary mt-4 mr-4 mb-3' >
            <Link to='/exp'>Exp</Link>
            </button>
        </nav>
    )
}
